import React from 'react';
import s from './Navbar.module.css'
import {NavLink} from 'react-router-dom'
const Navbar = () => {

    return(
        <div className={s.main}>
            <nav>
                <div className={s.main_nav}>
                    <NavLink className={navData=>navData.active? s.active : s.item}to ='/profile' >Profile</NavLink>
                    <NavLink className={navData=>navData.active? s.active : s.item} to ='/dialog' >Messages</NavLink>
                    <NavLink className={navData=>navData.active? s.active : s.item} to ='/music' >music</NavLink>
                    <NavLink className={navData=>navData.active? s.active : s.item} to ='/News' >News</NavLink>

                </div>
            </nav>
        </div>
    );
}
export default Navbar;
